import org.apache.commons.collections4.multimap.TreeValuedHashMap;
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        TreeValuedHashMap<String, Integer> map = new TreeValuedHashMap<>();
        HashMap<String, String> stringMap = new HashMap<>();
        TreeValuedHashMap<Integer, String> anotherMap = new TreeValuedHashMap<>();

        // Adding unrelated data to stringMap
        stringMap.put("A", "Apple");
        stringMap.put("B", "Banana");
        stringMap.put("C", "Cherry");

        // Adding unrelated data to anotherMap
        anotherMap.put(1, "One");
        anotherMap.put(2, "Two");
        anotherMap.put(3, "Three");

        // Iterating over stringMap to print its contents
        for (Map.Entry<String, String> entry : stringMap.entrySet()) {
            System.out.println("Key: " + entry.getKey() + ", Value: " + entry.getValue());
        }

        // Adding some unrelated data to map
        map.put("tempKey", 99);

        // Original write operation
        /* write */ map.put("key", 42);

        // Adding more unrelated data to anotherMap
        anotherMap.put(4, "Four");
        anotherMap.put(5, "Five");

        // Iterating over anotherMap to print its contents
        for (Integer key : anotherMap.keySet()) {
            System.out.println("AnotherMap Key: " + key + ", Value: " + anotherMap.get(key).iterator().next());
        }

        // Performing some unrelated computations
        int sum = 0;
        for (int i = 1; i <= 10; i++) {
            sum += i;
        }
        System.out.println("Sum of first 10 numbers: " + sum);

        // Original read operation
        /* read */ Integer value = map.get("key").iterator().next();
        System.out.println(value);

        // Adding unrelated data to the map
        map.put("extraKey", 88);

        // Iterating over map to print its contents
        for (String key : map.keySet()) {
            System.out.println("Map Key: " + key + ", Value: " + map.get(key).iterator().next());
        }

        // Final unrelated computation
        int product = 1;
        for (int i = 1; i <= 5; i++) {
            product *= i;
        }
        System.out.println("Product of first 5 numbers: " + product);
    }
}
